{"amount":{"type":"double","script":{"source":"          if (!doc.containsKey('url.query') || doc['url.query'].size() == 0) {
            emit(0.0); // Emit 0 if the field does not exist or is empty
            return;
          }
          String query = doc['url.query'].value;
          if (query.contains('amount=')) {
            int startIndex = query.indexOf('amount=') + 7; // 'amount='.length() = 7
            int endIndex = query.indexOf('&', startIndex);
            endIndex = endIndex == -1 ? query.length() : endIndex;
            String amountStr = query.substring(startIndex, endIndex);
            try {
              emit(Double.parseDouble(amountStr));
            } catch (NumberFormatException e) {
              emit(0.0); // Handle case where number is not parsable
            }
          } else {
            emit(0.0); // Emit 0 if 'amount=' is not found
          }"}}}
